def TipBeam(listofmomentbeam):
    listofmomentbeamTip = []
    tempdata = {}
    for i in listofmomentbeam:
        Mpr = i['Z33'] * i['Fy']
        Lh = i['Ln']
        dload = i['d_sum']
        lload = i['l_sum']
        sload = i['s_sum']
        alfa = 1.2
        beta = 1
        sigma = 0.2
        W = alfa * dload + beta * lload + sigma * sload
        Vpr = 2 * Mpr / Lh + W * Lh / 2
        i['tipvpr'] = Vpr
        if i['name'] in tempdata:
            if Vpr > tempdata[i['name']]['tipvpr']:
                tempdata[i['name']] = i
            else:
                continue
        else:
            tempdata[i['name']] = i

    for i in tempdata:
        listofmomentbeamTip.append(tempdata[i])

    return listofmomentbeamTip




